import React from 'react';
import './Components Styles/Main.css'

const Card = ({ val }) => {
  console.log(process.env.IMAGE_URL);
  return (
    <div className="cardContainer" id={val.id}>
      <h1>{val.heading}</h1>
      <p>{val.review}</p>
      <img src={process.env.IMAGE_URL + val.src} alt={val.name} width={'100%'} />
      <h3>{val.name}</h3>
      <p>{val.location}</p>
    </div>
  )
}

export default Card
